import './App.css';
import uuid from 'react-uuid'

function App() {
    let key = uuid();

    const users = [
        {id: 1, name: 'user1', surn: 'surn1', age: 30},
        {id: 2, name: 'user2', surn: 'surn2', age: 31},
        {id: 3, name: 'user3', surn: 'surn3', age: 32},
    ];

    const rows = users.map((elem) => <tr key = {elem.id}>
        <td>{elem.name}</td>
        <td>{elem.surn}</td>
        <td>{elem.age}</td>
    </tr>)

    return(
        < >
     <table>
        <tbody>
            <tr>
                <td>имя</td>
                <td>фамилия</td>
                <td>возраст</td>
            </tr>
        </tbody>
        <tbody>
            {rows}
        </tbody>
    </table>
    <p>
        {key}
    </p>
    </>
    )

}
export default App;
